function testMobile(){
    var deviceAgent = navigator.userAgent.toLowerCase();
    var agentID = deviceAgent.match(/(iphone|ipod|ipad|android|blackberry)/);
    if (!agentID) {
        $('select').dropdown();
        $('.ui.dropdown').addClass('fluid');
    }else{
        $('#btnCancelar').remove();
        $('#btnCancelarUsuarioTrocarImagem').remove();
    }

    return agentID;
}
testMobile();


